    "turtle-data-processing-system-tdps-turtle-strandings",nt"isopen": false,nt"url":
    null,nt"notes": "Effective management of marine turtle data is essential to
    maximize their research value and enable timely population assessments and recovery
    monitoring. To provide such capabilities at the National Marine Fisheries Service,
    a comprehensive Turtle Data Processing System (TDPS, formally called Marine Turtle
    Data Management System) was created. The system was written in DBase III and Clipper
    and implemented on IBM/PC-compatible computers running under MS-DOS. As of 2003,
    TDPS was upgraded into Microsoft Access. The TDPS is modular, supporting data of
    various types. Cross-referencing and multiple-encounter analysis are enabled through
    a core database file of individual turtle identifications, based on uniquely-inscribed
    flipper tags and passive-integrative transponder tags.",nt"license_title":
